import { Form, FormTitle, FormInput } from 'components/Common/Form';

function RegistrationScreen() {
  return (
    <Form>
      <FormTitle>RegistrationScreen</FormTitle>
      <FormInput />
    </Form>
  );
}

export default RegistrationScreen;
